  [],\n\t\"revision_timestamp\": \"2015-05-06T21:57:41.373999\",\n\t\"name\": \"lunar-materials-handling-system-project\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"The Lunar Materials Handling System (LMHS)
  is a method for transfer of lunar soil into and out of process equipment in support
  of in situ resource utilization (ISRU). The LMHS conveys solids to the ISRU vessel,
  provides a gas-tight seal, and minimizes wear related to abrasive particles. Lunar
  ISRU scenarios require that equipment be operated over many cycles with minimal
  consumption of expendables and with minimal leakage in order to maintain high overall
  process leverage. rnrnThe LMHS increases equipment life and minimizes process losses,
  thereby increasing overall leverage and reducing uncertainties in ISRU process evaluation.
  The LMHS is based on a seal arrangement by which lunar regolith can be introduced
  into and removed from reaction chambers operating under a wide range of batch operating
  conditions.rnrnMost lunar ISRU processes will use regolith as feed. Hydrogen reduction
  is a prime candidate for nearer-term lunar ISRU implementation. The LMHS was integrated
  with hydrogen reduction and operated in vacuum during Phase I. The LMHS-hydrogen
  reduction unit demonstrated feeding, sealing, water recovery for oxygen production,
  and discharging of residue in realistic operating conditions. rn\",\n\t\"license_title\":
